import React from 'react';
import '../App.css';
const Bottom = (props) => {
    const{number,add}=props;
    return (
        <div className='sub_container'>
            <h1>Bottom</h1>
            <button onClick={setnumber(number+1)}>증가</button>
        </div>
    );
};

export default Bottom;
